import React,{useState} from 'react'

function Weather() {
    const[city,setCity] = useState(0)
    return (
        <div>
            <h1>Open Weather</h1>
            <input type="number"
            value={city}
            onChange={e=>setCity(e.target.value)}
            />
        </div>
    )
}

export default Weather
